import React from "react";
import { listItemsStyle } from "../Category/style";

const Brands = (props) => {
  //console.log("hello", props);
  let renderItems = props?.brands?.map((item, index) => (
    <label key={index}>{item.brands}</label>
  ));
  console.log("filter", renderItems);
  return (
    <form action="/action_page.php">
      <label for="cars">Filter:</label>
      <select name="cars" id="cars">
        {renderItems}
      </select>
    </form>
  );
};

export { Brands };
